import React from 'react';
import {
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Chip,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import DownloadIcon from '@mui/icons-material/Download';
import MovieIcon from '@mui/icons-material/Movie';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
import HighQualityIcon from '@mui/icons-material/HighQuality';

const GlassTableContainer = styled(TableContainer)({
  background: 'rgba(26, 9, 51, 0.6)',
  backdropFilter: 'blur(10px)',
  borderRadius: '15px',
  border: '1px solid rgba(255, 71, 148, 0.1)',
  boxShadow: '0 8px 32px rgba(31, 17, 71, 0.4)',
  marginTop: '2rem',
  overflow: 'hidden',
  transition: 'transform 0.3s ease',
  '&:hover': {
    transform: 'translateY(-5px)',
    boxShadow: '0 12px 40px rgba(31, 17, 71, 0.6)',
  },
});

const StyledTable = styled(Table)({
  '& .MuiTableCell-root': {
    borderColor: 'rgba(255, 71, 148, 0.1)',
    color: 'white',
    padding: '16px',
  },
  '& .MuiTableHead-root .MuiTableCell-root': {
    background: 'rgba(255, 71, 148, 0.1)',
    fontWeight: 'bold',
  },
  '& .MuiTableRow-root:hover': {
    background: 'rgba(255, 71, 148, 0.05)',
  },
});

const DownloadButton = styled(Button)({
  background: 'linear-gradient(45deg, #FF4794 30%, #FF6CAB 90%)',
  border: 0,
  borderRadius: '25px',
  boxShadow: '0 3px 15px rgba(255, 71, 148, 0.3)',
  color: 'white',
  padding: '8px 24px',
  transition: 'all 0.3s ease',
  '&:hover': {
    background: 'linear-gradient(45deg, #FF6CAB 30%, #FF4794 90%)',
    boxShadow: '0 5px 20px rgba(255, 71, 148, 0.5)',
    transform: 'translateY(-2px)',
  },
});

const QualityChip = styled(Chip)({
  background: 'rgba(255, 71, 148, 0.1)',
  color: 'white',
  border: '1px solid rgba(255, 71, 148, 0.2)',
  '& .MuiSvgIcon-root': {
    color: '#FF4794',
  },
  '&:hover': {
    background: 'rgba(255, 71, 148, 0.2)',
  },
});

const DownloadOptions = ({ formats, onDownload }) => {
  if (!formats || formats.length === 0) return null;

  return (
    <GlassTableContainer>
      <StyledTable>
        <TableHead>
          <TableRow>
            <TableCell>الجودة</TableCell>
            <TableCell>النوع</TableCell>
            <TableCell>حجم الملف</TableCell>
            <TableCell>الصوت</TableCell>
            <TableCell>التحميل</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {formats.map((format) => (
            <TableRow key={format.formatId}>
              <TableCell>
                <QualityChip
                  icon={<HighQualityIcon />}
                  label={format.qualityLabel || 'صوت فقط'}
                />
              </TableCell>
              <TableCell>
                <QualityChip
                  icon={format.hasVideo ? <MovieIcon /> : <AudiotrackIcon />}
                  label={format.container.toUpperCase()}
                />
              </TableCell>
              <TableCell>
                <QualityChip
                  label={format.contentLength
                    ? `${(format.contentLength / 1024 / 1024).toFixed(1)} MB`
                    : 'غير معروف'}
                />
              </TableCell>
              <TableCell>
                <QualityChip
                  icon={<AudiotrackIcon />}
                  label={format.hasAudio ? 'متوفر' : 'غير متوفر'}
                />
              </TableCell>
              <TableCell>
                <DownloadButton
                  variant="contained"
                  startIcon={<DownloadIcon />}
                  onClick={() => onDownload(format)}
                >
                  تحميل
                </DownloadButton>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </StyledTable>
    </GlassTableContainer>
  );
};

export default DownloadOptions;
